-- ----------------------------
-- Table structure for api_info
-- ----------------------------
DROP TABLE IF EXISTS `api_info`;
CREATE TABLE `api_info` (
  `api_id` int NOT NULL AUTO_INCREMENT COMMENT '接口ID',
  `api_name` varchar(255) NOT NULL COMMENT '接口名称',
